    state = {
        good: 0,
        neutral: 0,
        bad: 0
    };
    render() {
        return (
            <div>
                <div>
                <h1>Please leave a feedback</h1>
                <button>Good</button>
                <button>Neutral</button>
                    <button>Bad</button>
                </div>
                <div>
                    <h2>Statistics></h2>
                </div>
            </div >
        )
    }
}
